export function imageToBase64(img: any) {
  let canvas = document.createElement('canvas');
  canvas.width = img.width;
  canvas.height = img.height;
  let ctx: any = canvas.getContext('2d');
  ctx.drawImage(img, 0, 0, img.width, img.height);
  let ext = img.src.substring(img.src.lastIndexOf('.') + 1).toLowerCase();
  let dataURL = canvas.toDataURL('image/' + ext);
  return dataURL;
}

export function getBase64Img(url: any) {
  if (!url) {
    return '';
  }
  let image = new Image();
  image.setAttribute('crossOrigin', 'Anonymous'); //解决图片跨域报错 ,需要放在图片赋值前，否则部分浏览器会报错
  image.src = url;

  return new Promise(function (resolve) {
    image.onload = function () {
      const data = imageToBase64(image);
      resolve(data);
    };
    image.onerror = function (e: any) {
      e.srcElement.src = '';
      resolve('');
    };
  });
}
